import React from 'react'

function OrderSummary({ cart }) {
    console.log(cart)
    if(cart.length > 0){

        return (
          <div className="order-summary-main">
              <div className="summary-title">
                  <h1>Order Summary</h1>
              </div>
              {cart.map((cart) => {
                  <div className="add-main">
                      <div className="item-total-text"></div>Item Total<div className="summary-item-total">${cart.price}</div>
                  </div>

              })}
          </div>
        )
    }
}

export default OrderSummary
